INSERT INTO `song` (`id`, `artist_id`, `disc_id`, `disc_order`, `title`, `description`, `release_time`, `year`, `price`, `price_type`, `genre`, `lyric`, `distribution_lyric`, `total_sec`, `artist_name`, `song_composer`, `lyricist`, `producer`, `label`, `isrc_code`, `radio_playable`, `is_released`, `is_deleted`, `create_time`, `modify_time`, `delete_time`) VALUES
(66841, 193740, 0, 1, '都一样', '歌曲收录在我们的 DIY 专辑里。[子想你听健]\n\n有些感情始终不能勉强, 有时却也只能选择退让, \n这辛酸, 真的要慢慢去释放 。 。 。\n', '2013-09-09 00:00:00', 2000, 20, 2, 4, '都一样  \n詞/Lydia 曲/周子健 & 黄治力 编曲/Tinz 唱/周子健\n\nVerse \n在眼前有一道微光  伸出双手握不到它   \n美丽的天堂  始终是幻想\n就算思念多么荒凉  对于未来有多彷徨\n那幸福的重量 要去衡量\n\nPre chorus\n感情始终不能勉强  却只能选择退让         这辛酸  要慢慢去释放\n如果说一直困在框  就好像没了翅膀          不能越过围墙\n\nChorus 1\n在爱里  原来我们都一样  都一样疯狂  一样的固执  逞强\n用尽自己的力量  却换来一身的伤      再一次感受  背叛\n\nChorus 2\n在爱里  原来你我都一样  都一样善良   一样受过一点  滚烫的伤\n每一次流的泪光  自己要学会擦干      要自己变得  坚强   (Pre chorus)\n', '', 222, '', '周子健 & 黄治力 ', 'Lydia', 'Tinz', '子想你听健', '', 0, 1, 0, '2013-09-18 20:24:53', '2015-03-12 14:02:08', '0000-00-00 00:00:00'),
(66842, 193740, 0, 1, '分岔路', '歌曲收录在我们的 DIY 专辑里。[子想你听健]\n\n是我在录音时，演唱最有画面的一首歌。\n当时的心情很低落，演唱着首歌，当中的滋味，只有我明白。', '2013-09-09 00:00:00', 2000, 20, 2, 4, '分岔路。  \n詞/陈舒宁 曲/谢松辉 編曲/Tinz 唱/周子健\n\nVerse \n不是每一个身影  都能够在心里面长住  \n感情的分布  提醒你藏在  最深处\n不是每一种幸福  都能够长久的被握住  \n有她的付出  我该很满足  对我的在乎\n\nPre chorus\n我懂我明白我清楚  只是回忆它不肯让步\n为你哭的那一幕  心痛程度  \n是我至今的  束缚\n\nChorus 1\n最后才了解我们从没有结束  \n沉溺于另一个虚幻国度\n理智与放纵  不停竞逐  \n然而到了最后  竟是双输\n\nChorus 2\n如果我们之间就是一张地图  \n你的所在是我的分岔路\n只要走错一步  那一种失误  \n也许足以将我  想要的幸福  颠覆 \n', '', 250, '', '谢松辉', '陈舒宁', 'Tinz', '子想你听健', '', 0, 1, 0, '2013-09-18 20:29:35', '2015-03-12 14:02:09', '0000-00-00 00:00:00'),
(66843, 193740, 0, 1, '只想告訴你', '属于超过10年的旧作，当时来说是第一首有完整编曲的作品。', '2013-09-09 00:00:00', 2000, 20, 2, 4, '只想告訴你。\n词/周子健  曲/周子健 & 世亮  编曲/Tinz &  陈鼎权 唱/周子健\n\nVerse \n就在那輛車子里 我們初次相遇 你的熱情偷走我的心\n我們認識只不過 只是半個星期 感覺上對你好熟悉\n\nPre Chorus\n天天我說我愛你 天天你叫我放棄 為何你怎么絕情\n雖然我不太帥氣 但是有善良的心 怎么你還不動心\n\nChorus\n只想告訴你 我愛你 因為我 被你偷了心\n只想告訴你 我決定 我決定擁抱你 感動你的心 \n親吻你\n', '', 204, '', '周子健 & 世亮', '周子健', 'Tinz & 陈鼎权', '子想你聽健', '', 0, 1, 0, '2013-09-18 22:37:59', '2015-03-12 14:02:09', '0000-00-00 00:00:00'),
(66844, 193740, 0, 1, '女巫的愿望 ', '是我作品中少有的快歌。', '2013-09-09 00:00:00', 2000, 20, 2, 4, '女巫的愿望。   \n词/bp铭馨  曲/周子健  编曲/Tinz  唱/周子健\n\nVerse 1\n在那个山丘上 有一间木屋 黑漆漆的不知有没有人住 \n偶尔还有休息的蝙蝠 吊在栏杆上装糊涂 \n\nVerse 2\n小时候的我 捧着故事书 妈妈说书中自有黄金屋 \n我的书却只有女巫害公主 公主最终都有王子去保护 \n\nChorus 1\n女巫的愿望是什么？ 她是否在研究新的毒？ \n那个山丘上的木屋 是否就住了这样个女巫？ \n昨晚我梦见了女巫 她点燃了蜡烛 对我哭诉\n从前她走错好多步 现在改吃素 她说要用下辈子去弥补 (她说要用下辈子弥补)\n\nChorus 2\n女巫的愿望是什么？ 她是否在研究新的毒？ \n那个山丘上的木屋 是否就住了这样个女巫？\n昨晚我梦见了女巫 她握着我的手救我帮助\n现在的他已经醒悟 不再狠毒 她要为全世界的人祝福\n', '', 199, '', '周子健', 'bp铭馨', 'Tinz', '子想你聽健', '', 0, 1, 0, '2013-09-18 22:41:55', '2015-03-12 14:02:09', '0000-00-00 00:00:00'),
(66845, 193740, 0, 1, '是你真的忘了吗', '属于旧作品，写了该有超过10年了，是在这几年才完整制作和录音。\n是治力有故事的作品。。。我不想透露太多，怕被灭口。呵呵。', '2013-09-09 00:00:00', 2000, 20, 2, 4, '是你真的忘了吗。 \n词曲/黄治力  编曲/Tinz  唱/周子健\n\nVerse 1\n经过多少岁月无情煎熬  期盼的曰子终于来到  \n此刻的我 竟然想逃  不想被人寻着\n\nVerse 2\n明明跟自己约定说好 你并不是那么的重要   \n却把自己困在无人小岛 不想再有浪潮\n\nPre Chorus\n我尝试把自己烦恼减少 不要再因你有所困扰\n或许你真的想逃 但此刻的我只想知道\n\nChorus 1\n是你真的忘了吗 还是你害怕 笑你傻  \n或许这样算了吧 别再痴痴的等好吗\n\nChorus 2\n是你真的忘了吗 还是你真的没办法   \n最好把你忘了吧 就让感情从此蒸发\n', '', 257, '', '黄治力', '黄治力', 'Tinz', '子想你聽健', '', 0, 1, 0, '2013-09-18 22:44:51', '2015-03-12 14:02:09', '0000-00-00 00:00:00'),
(66846, 193740, 0, 1, '下一個', '歌曲收录在我们的 DIY 专辑 [舒宁-情舒宁愿专属]里 ，同时也入围了马来西亚2012年娱协音乐颁奖典礼-独立音乐歌曲奖。', '2013-09-09 00:00:00', 2000, 20, 2, 4, '下一个。  \n词曲/陈舒宁 唱/陈舒宁 & 周子健\n\n寧：你和他曾那么深刻 幸福早已获得认可 你怎么忍心 不记得 \n健：是谁说过最深爱的 往往不是身边那个 但我从前如何 会晓得 \n寧：是否从新选择  健：就从此踏实的爱着 \n女：会不会后悔呢 健：以后别去预测 \n女：就算真的爱了 健：谁能保证不会有 下一个 \n合：让我们走得 比现在更曲折 \n寧：谁哭着换谁快乐 健：这画面一直从复的刻着 \n寧：生命有太多必须要割舍 合：伤会慢慢愈合 \n寧： 我们都在煎熬着 健：苦涩只因为太过贪心 寧： 也许放弃是你的选择 合：但我舍不得', '', 262, '', '陈舒宁', '陈舒宁', '陈舒宁 & Tinz', '情舒宁愿专属', '', 0, 1, 0, '2013-09-18 22:56:05', '2015-03-12 14:02:09', '0000-00-00 00:00:00'),
(66847, 2943, 6081, 1, '承諾', '', '2012-01-13 00:00:00', 2000, 30, 0, 7, '閉上眼睛讓回憶不再浮現\n忍住呼吸深怕煙硝的氣味\n忘了心跳   發瘋的逃跑\n逃離那      記憶的牢（逃離你     溫柔的笑） \n\n這世界   說多情太虛偽\n情難捨   就留在夢中隱隱作痛\n別回頭   別輕易地說你愛我\n我沒有時間作承諾\n', '', 208, '', '', '', '', '一鴻', '', 0, 1, 0, '2013-09-19 07:02:16', '2015-03-12 14:02:09', '0000-00-00 00:00:00'),
