(66852, 2943, 6081, 6, '桐花雪', '', '2012-01-13 00:00:00', 2000, 30, 0, 4, '等 我一個人等\n等太陽西沉\n等路燈 等行人 等關門\n等 我繼續在等\n等回憶閃神\n等頭昏 等到黑暗都已那麼深\n只因你曾經說過\n白色花心紅的火\n在不雪的季節\n會下成白茫茫的花雪\n\n五月雪 開滿了孤單的長夜\n樹梢上 凋落的花雪就像我的心碎\n桐花雪 竟下在孤單的狂歡夜\n你離開我 離開了我\n絢麗也只是 殘缺', '', 310, '', '', '', '', '一鴻', '', 0, 1, 0, '2013-09-19 08:07:59', '2015-03-12 14:02:09', '0000-00-00 00:00:00'),
(66853, 2943, 6081, 7, '桐花開', '', '2012-01-13 00:00:00', 2000, 30, 0, 5, '有時候 會覺得 失去方向\n有時 會感到迷惘\n有時候 會覺得 失去肩膀\n有時 會感到沮喪\n當天空 越寬廣 視線越明亮\n心情 卻每下愈況\n當生活 越匆忙 人越複雜\n就會 想念那個天堂\n(天堂裡會盛開著桐花)\n\n桐花開 開在故鄉的山上\n開在 思念的土壤\n桐花開 開滿手中的力量 \n堅持 就能變成信仰\n桐花開 開在遙遠的他方\n開在 遊子的心房\n桐花開 開滿愛人的臉龐\n一笑 就能聞到芬芳\n(一笑 就會變成太陽)', '', 264, '', '', '', '', '一鴻', '', 0, 1, 0, '2013-09-19 08:17:48', '2015-03-12 14:02:09', '0000-00-00 00:00:00'),
