(66856, 2943, 6081, 10, '金門的風', '', '2012-01-13 00:00:00', 2000, 30, 0, 5, '金門的海風　一陣又一陣　鹹鹹的海味　親像海浪的退進(起落)\n\n金門的海風　吹頭又吹面　鹹鹹的海味　親像海島的人生。\n\n爬上太武山　海風跟上山　鹹鹹的海味　是風吹乾我的汗\n\n來去后湖海  牽罟挖沙礪  鹹鹹的海味  是海給我吃跟用(穿)。\n\n金門的海風  風吹微微涼  鹹鹹的海味　隨風睏一個好暝\n\n金門的海風  風吹微微涼  鹹鹹的海味  隨風作一個好夢。\n', '', 287, '', '', '', '', '一鴻', '', 0, 1, 0, '2013-09-19 08:38:10', '2015-03-12 14:02:09', '0000-00-00 00:00:00'),
(66857, 2943, 6081, 11, '比鼻去西邊取經', '', '2012-01-13 00:00:00', 2000, 30, 0, 7, '為什麼非得爬得更高看更廣闊的天空\n好希望時間停止轉動，沒想法好好放空\n可是\n\n有好多的夢      在腦中冷凍\n不把它拿出來解凍\n總有一天會長蟲\n\n\n我快要變成了孫悟空，飛到西呀飛到東\n想要找到我的如來佛，but… God, it''s Jennifer（please, Jennifer no more）\n不過\n\n有太大的夢，還是要珍重\n聽這首簡單的創作\n你我一起來加加油\n\n比鼻    比鼻    別擔心  \n全宇宙   都在幫你\n上帝、阿拉和觀世音 \n(加嗯、依違、和飯新於)\n天下的神明都是一樣地 \n（還有香薷and你阿姨） 修逼嘟哇\n\n比鼻 比鼻 要開心\n願望一定會實現地\n（這一段我想來個R&B）\nLA、Boston、New York City\n全都張開雙手擁抱你 (給我乖乖拿出獎學金)\n\n1234', '', 224, '', '', '', '', '一鴻', '', 0, 1, 0, '2013-09-19 08:43:41', '2015-03-12 14:02:09', '0000-00-00 00:00:00'),
(66858, 2943, 6081, 12, '金門酒', '', '2012-01-13 00:00:00', 2000, 30, 0, 5, '金門人，金門酒，土豆配燒酒，\n酒入喉，話就滑，大事化小啊小化無。\n\n金門人，金門酒，酒烈人情厚，\n雞頭乾，魚尾乾，能飲多飲啊不論杯。\n\n金門人，金門酒，酒香千里遠，\n海島命，走四方，順嘴的，還是這杯高粱酒。\n', '', 218, '', '', '', '', '一鴻', '', 0, 1, 0, '2013-09-19 08:49:34', '2015-03-12 14:02:09', '0000-00-00 00:00:00'),
