(66882, 15059, 6065, 8, '最後的暗暝', '', '2013-09-04 00:00:00', 2000, 19, 0, 1, '最後的暗暝〉\n詞：林正尉 曲：張育嘉 編曲：BIKE樂團		\n\n聽我講心愛的 為何你今夜要離去\n明明知影 惦惦放手 雨潑眼淚風隨\n你常講牽咱的情 勇敢做夢作夥去\n後伴絕情 當時的理想 勿通放棄\n\n是命運決心來失去\n還是你已跟好的人生\n賣擱相信 咱過去苦痴的戀情\n這是我最後給你的歌曲\n\n請對我講心愛的人 勿通回頭望離悲\n咱的過去 快放心腹底 賣擱講起\n你和我 夢過的夢 留我孤人對他眠\n咱的笑面 當時的歡喜 心愛的你\n\n為何你冷冷割開我的心\n還是決定跟他走人生 \n賣擱傷心 今夜咱落雨的戀情\n這是我最後陪你的暗暝\n', '', 273, '', '林正尉', '張育嘉', 'BIKE樂團', '禾廣代理發行', 'TWS651314028', 1, 1, 0, '2013-09-19 20:50:23', '2015-03-12 14:02:10', '0000-00-00 00:00:00'),
