(66890, 168542, 0, 1, '牛奶斌－夸父追日', '「有時候很堅強，有時候卻很脆弱」 \n夢想好遠，\n我們都有不得不向現實低頭的理由。\n但別放棄追尋，\n因為，\n抬頭，就有巨人走過。\n', '2013-09-20 00:00:00', 2000, 19, 1, 2, '夸父追日　　　詞：悠遊虎／牛奶斌　　曲／編曲：牛奶斌\n\n小時候聽過 夸父追日的故事\n長大之後覺得哈哈哈  怎麼這麼白癡\n太陽離地球一千四百九十多億公尺\n根本是不可能不可能不可能的事\n\n聽說小學作文題目還是我的大志\n海賊超人魔法師 一樣超出常識\n長大之後他們會明白自己的無知\n生平無大志  也無法保持熱情\n\n勇氣是什麼  出發是什麼意思\n看看電影才覺得被感動有點勵志\n當小時候的天真可愛變成現實\n我們開始嘲笑追求夢想這一件事\n\n喔 這世界阿  夢如此遙遠\n喔 什麼情形  已經不能更糟\n\n\n夸父追日我日日追隨你的影子\n試圖揣測你勇敢的樣子\n提醒自己不要像個孩子  整天只會哭哭啼啼\n夸父追日我夜夜變回膽小的獅子\n好想找回被遺忘的過去\n過去快樂與無懼的追求   已變為刺人的殘殤與作夢的幼稚\n\n\n時間到了國中我們重新學習成語\n大禹治水愚公移山  偉大的歷史\n有個同學突然舉手說 這太假了,老師\n輕浮地笑著就這樣 過了一日\n\n一日復一日在漸漸繁華的城市\n畢業的我自問應該到哪裡去\n吃了又睡睡了又吃夢在消失\n突然想起有個人在背後默默的支持\n\n勇氣是什麼   出發是什麼意思\n看看電影才覺得被感動有點勵志\n當小時候的天真可愛變成現實\n我們開始嘲笑追求夢想這一件事\n\n喔 這世界阿  夢如此遙遠\n喔 什麼情形  已經不能更糟\n\n夸父追日我日日追隨你的影子\n試圖揣測你勇敢的樣子\n提醒自己不要像個孩子  整天只會哭哭啼啼\n夸父追日我夜夜變回膽小的獅子\n好想找回被遺忘的過去\n過去快樂與無懼的追求   已變為刺人的殘殤與作夢的幼稚\n\n\n\n', '', 370, '', '牛奶斌', '悠遊虎／牛奶斌', '牛奶斌', '牛奶斌', '', 0, 1, 0, '2013-09-20 22:03:45', '2015-03-12 14:02:10', '0000-00-00 00:00:00'),
