(66898, 15059, 6065, 9, '銀河火箭', '', '2013-09-04 00:00:00', 2000, 19, 0, 1, '〈銀河火箭〉\n詞/曲：張育嘉 編曲：BIKE樂團\n\n睡夢中我聽見你在我耳邊細語\n似乎是人造衛星傳遞了訊息\n浩瀚星空裡有令人著迷的聲音\n我無力抗拒卻說不出任何原因\n\n今夜你又召喚我去銀河裡旅行\n我欣然的接受你優雅地邀請\n無法壓抑自己逐漸高漲的情緒\n唱起一首曾經遺忘很久的歌曲\n\n我們乘著夢想火箭去太空裡冒險\n希望找到星星的碎片\n跟著流星一起航向宇宙的最邊緣\n不管前方有沒有危險\n', '', 285, '', '張育嘉', '張育嘉', 'BIKE機踏車樂團', '禾廣代理發行', 'TWS651314029', 1, 1, 0, '2013-09-20 23:50:11', '2015-03-12 14:02:10', '0000-00-00 00:00:00'),
(66899, 155755, 5787, 2, '黎明之歌', '', '2013-04-30 00:00:00', 2000, 10, 2, 16, '生命中出現裂痕的時候，是痛。\n但只有裂開了，才能讓光線透過去。\n\n黑夜過去，黎明就要升起。', '', 107, '', 'Eden', '', 'Eden', 'EN MUSIC 異恩音樂', '', 0, 1, 0, '2013-09-21 16:58:17', '2015-03-12 14:02:11', '0000-00-00 00:00:00'),
(66900, 5224, 0, 1, '更好的去向', '相信我們都能擁有更好的去向', '2013-09-22 00:00:00', 2000, 19, 0, 6, '像海嘯\n一轉身失去了所有\n\n像一場午睡做的夢\n\n一個人的選舉\n孤獨的舉行\n\n選出自己照顧他自己\n\n怎麼說呢\n不是故意一個人\n\n但你也知道\n沒辦法的事總是沒辦法\n\n「說服自己」\n沒有比這更難的立場\n\n除了這裡如果還有\n更好的去向\n\n離開現在\n等待的是無限的等待\n\n關於未來\n我想我就不要再做夢\n\n就算我會忘記我曾這麼說\n\n只要我知道\n沒辦法的事總會有辦法', '', 307, '', '謝至平', '謝至平', '謝至平', '謝至平', '', 0, 1, 1, '2013-09-21 22:18:48', '2014-01-28 16:26:29', '2014-01-28 16:26:29'),
(66901, 15059, 6065, 10, '美好的一天', '', '2013-09-04 00:00:00', 2000, 19, 0, 1, '〈美好的一天〉\n詞/曲：張育嘉 編曲：BIKE樂團\n\n睜開雙眼我看見今天陽光很耀眼\n我告訴我自己這是美好的一天\n微風吹過我的臉帶我逃離這世界\n我只想要加緊油門衝向地平線\n\n不管前方有多少的困難擋在前\n我想我都不會再膽怯\n就算路途遙遠讓我模糊了視線\n我還是會一路走向前\n', '', 277, '', '張育嘉', '張育嘉', 'BIKE機踏車樂團', '禾廣代理發行', 'TWS6513140230', 1, 1, 0, '2013-09-21 22:37:46', '2015-03-12 14:02:11', '0000-00-00 00:00:00'),
(66902, 120392, 0, 1, '翻滾吧女孩', '來回憶一下純純的愛吧!', '2013-09-21 00:00:00', 2000, 1, 0, 4, '<主歌>\n翻滾吧女孩 可不可以 不要穿那麼短\n翻滾吧女孩 你的心怎 麼可以這麼的軟\n翻滾吧女孩 總是笑的 那麼燦爛\n我不是想把女孩  只是有首  歌想請你聽聽看\n<副歌>\n也許 這 不是夢 有天我會牽妳的手 我們可以一起享受那愉 快 的午後\n海平面 的日落 伴著鹹鹹的海風   闖進那 繁星點點的夜空\n也許你 對 我  好像也有點心動  指是有點害羞  不知道該怎麼說\n不要皺眉頭 難過記得告訴我 我可以 帶你一起遨遊全 宇 宙\n\n也許 這 不是夢 有天我會牽妳的手 我們可以一起享受那愉 快 的午後\n我沒裝 火箭筒 你要緊緊抱著我   闖進那 繁星點點的夜空\n也許你 會 懂  為何不裝火箭筒  只是想你額頭  輕輕靠在我背後\n不要皺眉頭 難過記得告訴我 我可以 帶你一起遨遊全 宇 宙\n ', '', 196, '', '黃楗騰', '林元泰.黃楗騰', '黃楗騰', '翻滾笑年', '', 0, 1, 0, '2013-09-22 00:34:06', '2015-03-12 14:02:11', '0000-00-00 00:00:00'),
(66903, 128435, 6532, 4, '魚', '暑假環島完寫的', '2013-09-22 00:00:00', 2000, 19, 2, 1, '魚離不開水\n水不需要魚\n人離不開社會\n社會不一定要你\n\n魚兒在清澈的河裡悠游\n自由自在\n我們在渾沌的社會打滾\n腐敗\n\n如何找到自己的定位\n有思考才知道\n不需要太去附和那些墮落的人\n走出腐敗的想法\n\n我離不開社會\n也離不開我所深愛的人\n隨波逐流載浮載沉著\n到底算什麼\n', '', 328, '', '', '', '', '如何設計C++程式', '', 0, 1, 0, '2013-09-22 22:18:24', '2015-03-12 14:02:11', '0000-00-00 00:00:00'),
(66904, 75118, 6041, 1, '極光', '', '2013-09-24 00:00:00', 2000, 20, 0, 5, '極光\n詞：吳青峰\n曲：蔡健雅\n\n還不清楚 什麼是真是假\n還不知道 何時太陽忽然會來\n該怎麼辦 竟然期待黑暗\n該怎麼樣 相信運氣不會太壞\n \n你和我之間的愛 在不在磁場之外\n要追求一種平淡 還是要一種絢爛\n燒得像場火災 天時地利才來\n日復一日的提問 我 還沒有答案\n \n來太快了 反而不真實了\n太感動了 反而害怕要消失了\n不敢眨一眨眼 怕你轉身不見\n每個瞬間 都想拍下當作紀念\n \n你和我之間的愛 是不是一場意外\n絢爛之後的對白 脫下神秘的色彩\n會是變成習慣 還是完全推翻\n一生一次的奇幻　像是沒有答案\n\nDu Du Du La…\n\n都為了愛 時時刻刻期盼\n都為了愛 翻山越嶺 該或不該\n為了怎樣的愛 我們計算失敗\n怎樣的愛 值得我們這樣等待\n \n你和我之間的愛 是不是一場意外\n絢爛之後的對白 脫下神秘的色彩\n會是變成習慣 還是完全推翻\n極光雖然夢幻 卻不能總在你身旁陪伴\n\n日復一日的曙光 其實也變化多端\n細水長流的平淡 也走過萬水千山\n繞過每個轉彎 風景並不簡單\n我該當你的極光 還是你的答案\n \n我的答案 那麼簡單\n', '', 320, '', '', '', '', '亞神音樂AsiaMuse', '', 0, 1, 0, '2013-09-23 17:56:04', '2015-03-12 14:02:11', '0000-00-00 00:00:00'),
(66905, 75118, 6041, 3, '費洛蒙', '', '2013-09-24 00:00:00', 2000, 20, 0, 5, '費洛蒙\n 詞：吳青峰\n曲：蔡健雅\n\n要不要為我犯個罪  暫時聽信蛇的語言\n而我夢見馬蹄四濺  蘋果沾了一些汗水\n \n月光下貓勾起了背  狼群環視四周的夜\n那魚群天生就愛水  猛獸吞噬我的視線\n空氣中瀰漫著氣味\n \nCause I feel\nI’m ready for love, yes I’m ready for love\nAnd I know\n是什麼在我的身邊緊緊跟隨\nI’m ready for love\nReady for love\n \n蝴蝶穿梭花粉之間  春天開得那麼鮮艷\n千萬隻眼睛的孔雀  背景音樂蛙聲遍野\n空氣中強烈著幻覺\n \nCause I feel\nI’m ready for love, yes I’m ready for love\nAnd I know\n是什麼在我們身邊牽一條線\nI’m ready for love\nReady for love\n\nCause I feel\nI’m ready for love, yes I’m ready for love\nAnd I know\n是什麼在我的身邊緊緊跟隨\nI’m ready for love\nReady for love\n', '', 234, '', '', '', '', '亞神音樂AsiaMuse', '', 0, 1, 0, '2013-09-23 18:01:16', '2015-03-12 14:02:11', '0000-00-00 00:00:00'),
(66906, 75118, 6041, 5, '天使與魔鬼的對話', '', '2013-09-24 00:00:00', 2000, 20, 0, 5, '天使與魔鬼的對話\n 詞／曲：蔡健雅\n\n他說他不明白　為何我那麼奇怪\n他總是說我太　不樂觀不容易猜\n白天時說我好愛好愛他\n深夜卻突然　動不動說要分開\n我心像舊房子壁紙當層層被撕下來\n最深處原來存在\n\n天使與魔鬼的對話 ah ah ah ah ah ah \n串通一片陰霾 混淆我\n怕失去愛又怕被愛 ah ah ah ah ah 愛\n懷疑他是否該 還不該\n愛上我這樣的女孩\n\n我不乖也不壞　只是有點無　奈\n越靠越近我就　莫名越想逃　開\n人的各種恐懼障礙若不積極去面對\n會養成永久習慣\n看著天和地獄之間的人們都在相愛\n只剩下我在對抗\n\n天使與魔鬼的對話 ah ah ah ah ah ah \n串通一片陰霾 混淆我\n怕失去愛又怕被愛 ah ah ah ah ah 愛\n懷疑他是否該 還不該\n愛上我這樣的女孩\n\n人的各種恐懼障礙若不積極去面對\n會養成永久習慣\n看著天和地獄之間的人們都在相愛\n只剩下我被困在\n\n天使與魔鬼的對戰 ah ah ah ah ah ah \n串通一片陰霾 混淆我\n怕失去愛又怕被愛 ah ah ah ah ah 愛\n懷疑他是否該 還不該\n愛上我這樣的女孩 ah ah ah ah ah ah \n串通一片陰霾 混淆我\n怕失去愛又怕被愛 ah ah ah ah ah 愛\n懷疑他是否該 還不該\n愛上我這樣的女孩 ah ah ah ah ah ah \n\n', '', 252, '', '', '', '', '亞神音樂AsiaMuse', '', 0, 1, 0, '2013-09-23 18:06:45', '2015-03-12 14:02:11', '0000-00-00 00:00:00'),
(66907, 75118, 6041, 6, '唱衰', '', '2013-09-24 00:00:00', 2000, 20, 0, 5, '唱衰\n\n詞：李焯雄\n曲：蔡健雅\n\n不是你想要怎樣 事實就可以怎樣\n但為什麼我不敢 愛怎樣就怎樣想\n傲慢與嫉妒 懶惰與暴怒\n貪婪貪食色慾\n無法被馴服 無法被消毒\n有個我誠實但不無辜\n\n想瘋狂 想悲傷\n想誇張 想張揚就不想不痛不癢\n想胡來 想不太可愛\n想破壞 壞壞壞不辯論該與不該 \nWoo Woo 不唱好 我來 唱衰\n\n不是你想要怎樣 世界就會變怎樣\n為何我拼命高尚 只為成全你所想\n\n謙讓與寬容 勤勉與忍辱\n慷慨節制禁慾\n我被誰禁錮   還自我刪除\n有個我不偽善但可惡\n\n想瘋狂 想悲傷\n想誇張 想張揚就不想不痛不癢\n想胡來 想不太可愛\n想破壞 壞壞壞不辯論該與不該 \nWoo Woo 不唱好 我來 唱衰\n\n膽敢說不  我可以更露骨\n不必驅除  黑暗未必有毒\n膽敢說不  我可以更頑固\n誰都唱好  我唱衰說 不\n\n想瘋狂 想悲傷\n想賴帳 想補償就不想不痛不癢\n想胡來 想不太可愛\n想破壞 壞壞壞不辯論該與不該 \nWoo Woo 不唱好 我來 唱衰\n\nWoo 不唱好 我來 唱衰\n來 唱衰\n來 唱衰\n', '', 254, '', '', '', '', '亞神音樂AsiaMuse', '', 0, 1, 0, '2013-09-23 18:11:48', '2015-03-12 14:02:11', '0000-00-00 00:00:00'),
(66908, 75118, 6041, 7, '墜落', '', '2013-09-24 00:00:00', 2000, 20, 0, 5, '墜落\n 詞／曲：蔡健雅\n\n總認為這個世界　沒有我無所謂\n這樣的感覺或許從以前就在\n努力獨自面對　倔強的以為\n沒人能體會我這孤獨的傷悲\n\n就別抱緊我　別安慰我\n就放棄我　讓我繼續墜落\n愛是什麼顏色?\n模糊了　忘記了\n似乎愛曾與我擦肩而過\n卻不曾逗留也從不屬於我\n\n心已破碎的我　該要如何振作\n一身的防備只想躲進個角落\n把真心話說穿了　我真的累了\n經歷過曲折最後又得到什麼\n\n就別抱緊我　別安慰我\n就放棄我　讓我繼續墜落\n愛是什麼顏色?\n模糊了　忘記了\n似乎愛曾與我擦肩而過\n卻不曾逗留也從不屬於我\n\n羨慕那些有完美生活的你們\n童年記憶的快樂多過傷痕\n生命開的玩笑有沒有分寸？\n帶走了我的天真\n\n就別抱緊我　別安慰我\n就放棄我　讓我繼續墜落\n別說為我心疼　捨不得　我瘋了\n別說陽光在遠方等著我\n它不曾來過　它從不屬於我\n', '', 250, '', '', '', '', '亞神音樂AsiaMuse', '', 0, 1, 0, '2013-09-23 18:17:03', '2015-03-12 14:02:11', '0000-00-00 00:00:00'),
(66909, 75118, 6041, 8, '被馴服的象', '', '2013-09-24 00:00:00', 2000, 20, 0, 5, '被馴服的象\n 詞：徐熙娣（小Ｓ）\n曲：蔡健雅\n\n到底要笑得多虛偽　才能夠融入這世界\n每個人的臉上都像是貼了張一樣的假面\n想不起我在做什麼　想不起我在想什麼\n想不起靈魂深處　到底發生了什麼\n\n迷霧 迷霧 在迷霧　我驚覺自己在原地踏步\n到底是誰把我心矇住　不想再糊塗\n迷路 迷路 迷了路　我就徹底被這團迷霧困住\n誰能夠指引我一條路　帶我走上正途\n\n裝不出融入的態度　空氣裡充斥著虛無\n說什麼都掩飾不了我這局外人的侷促\n想不通自己怎麼了　想不通世界怎麼了\n想不通心靈深處　到底變成什麼了\n\n掌聲 若需要掌聲　只要你願當被馴服的象\n這舞台你就可以上　榮耀 勝過被嘲笑 \n所以拋開自尊　咬緊牙根硬撐\n', '', 209, '', '', '', '', '亞神音樂AsiaMuse', '', 0, 1, 0, '2013-09-23 18:21:26', '2015-03-12 14:02:11', '0000-00-00 00:00:00'),
(66910, 75118, 6041, 10, 'Keep Breathing', '', '2013-09-24 00:00:00', 2000, 20, 0, 5, 'Keep Breathing\n 詞：葛大為\n曲：蔡健雅\n\n\n讓陽光 照進來\n我心房裡那一片灰暗\n那片海 沒有岸\n我漂浮著但是離不開\n將呼吸 再緩慢\n證明自己還存在\n\nKeep Breathing\nBreathing\nBreathing\nBreathing\nKeep Breathing\n\n我努力活 去相處著\n那些不快樂\n也努力過 去相信著\n我是愛我的\n\n越是簡單越困難呢\n我從前不曉得\n\n夢醒來 淚擦乾\n學會跟另一個我坦白\n面對面 別隱瞞\n那些疼痛其實沒離開\n將呼吸 再緩慢\n聆聽身體的獨白\n\nKeep Breathing\nBreathing\nBreathing\nBreathing\nKeep Breathing\n\n\n有些傷口 很難癒合\n我只能感受\n有些寂寞 沒人懂得\n我試著接受\n\n越是簡單越困難呢\n我現在才曉得\n\n夢醒來 淚擦乾\n學會跟另一個我坦白\n面對面 別隱瞞\n那些疼痛就算沒離開\n將呼吸 再緩慢\n其實我並不孤單\n\nKeep Breathing\nBreathing\nBreathing\nBreathing\nKeep Breathing\n', '', 312, '', '', '', '', '亞神音樂AsiaMuse', '', 0, 1, 0, '2013-09-23 18:27:51', '2015-03-12 14:02:11', '0000-00-00 00:00:00'),
