(66936, 2724, 6085, 10, 'X', '', '2013-09-12 00:00:00', 2013, 20, 0, 1, '今天心情很不好，喝了一點酒 \n努力了這麼久，換來一場夢 \n所以我跑去找我，最好的朋友 \n看到他我的眼淚，竟然一直流 \n\n雖然我們真的沒有認識很久 \n但是我們有眉毛就能夠溝通 \n經過漂亮的女生都一起回頭 \n再不能說的秘密我都跟你說 \n\n搭上火箭飛上天空 偉大的航道算什麼 \n拿出屬於我們的旗子 用力把它插在月球 \n就算回家的燃料不夠 至少氧氣還有很多 \n一起舉起我們的右手 在對著地球吐舌頭 \n\n大家都說我的脾氣很難捉摸 \n大概也只有你們能夠忍受我 \n在這邊跟老天爺拜託拜託 \n我的好朋友一定要活很久很久 \n\n『到月球』 就算！回家燃料不夠！ \n至少！氧氣還有很多！ \n一起來！一起來！一起來！一起來！ \n舉起你的右手！ Let''s﻿ Go!\n', '', 257, '', '', '', '', 'Wonder Music 彎的音樂', '', 1, 1, 0, '2013-09-24 11:41:36', '2015-03-12 14:02:12', '0000-00-00 00:00:00'),
