(66941, 2724, 6085, 15, '流浪王子(鋼琴版)', '', '2013-09-12 00:00:00', 2013, 20, 0, 1, '', '滴滴答答 嘟嘟答答 王子離開了城堡\n滴滴答答 嘟嘟答答 有股熟悉的味道\nstop stop stop stop 是一個扭曲的城堡\n叮咚叮咚 有沒有人在家 有個公主在陽台上\n我用望遠鏡看她 她的表情很驚訝\n畫面一張一張貼上 竟然是我錯過的她\n&\n我本來十一點要回家 為了妳我決定要流浪\n我覺得妳的城堡一定會倒塌\n快跟我走吧\n我以為只要流浪一下 沒想到鬍子變那麼長\n妳說妳怕城堡外面的大野狼\n有我在不用怕\n*\n等呀等呀等呀等呀 王子變成青蛙\n呱呱呱呱 長出了南瓜 要不要上來呀\n風大雨大太陽也大 妳卻睡的很香\n唉唷為呀唉唷為呀 我是不是應該回家\n我用望遠鏡看她 她也用望遠鏡看我\n我說我真的要走了 她看起來卻捨不得\n＆REPEAT＆\n*\n跟我走吧 把我鬍子刮一刮\n妳說在等一下 What the fuck\n跟我走吧 妳這一個傻瓜\n妳說妳選擇留下 ......\nHmm.......', 286, '', '', '', '', 'Wonder Music 彎的音樂', '', 1, 1, 0, '2013-09-24 11:43:09', '2015-03-12 14:02:12', '0000-00-00 00:00:00'),
